import React from "react";
import { BrowserRouter as Router, Link, Route, Switch } from "react-router-dom";
import TodoApp from "./TodoApp/TodoApp";
import HackerNewStories from "./HackerNewStoriesApp/HackerNewStories";
import styled from "styled-components";

const StyledNavbar = styled.nav`
  background: inherit;
  color: #067ded;
  fontweight: 600;
  fontsize: 18px;
`;

export const App = () => {
  return (
    <Router>
      <div className="container-fluid">
        <Switch>
          <Route path="/todo-app">
            <TodoApp />
          </Route>
          <Route path="/stories-app">
            <HackerNewStories />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
};

export default App;

export const Home = () => {
  return (
    <div>
      <StyledNavbar className="d-flex justify-content-end">
        <ul className="nav">
          <li className="nav-item">
            <Link to="/">
              <span className="nav-link">Home</span>
            </Link>
          </li>
          <li className="nav-item">
            <Link to="/todo-app">
              <span className="nav-link">Todo App</span>
            </Link>
          </li>
          <li className="nav-item">
            <Link to="/stories-app">
              <span className="nav-link">Hacker News Stories App</span>
            </Link>
          </li>
        </ul>
      </StyledNavbar>

      <h1>My App</h1>
    </div>
  );
};
